Beschrijving:
Al 1200+ keer verkocht op de site van Drive Hydro!
 De waterafstotende folie van Drive Hydro is dè oplossing voor beter zicht in het verkeer! Bij een normale windscherm op een scooter hecht regen en ander vloeistof aan het oppervlak waardoor het zicht beperkt is, resulterend in ongelukken. 
 De waterafstotende folie van Drive Hydro is voorzien van een waterafstotende laag met nano technologie waardoor regen en ander vloeistof per direct van het oppervlak afdruipen. Water en andere vloeibare stoffen kunnen zich niet hechten aan de Drive Hydro waterafstotende folie. 

Geschikt voor alle soorten en maten windschermen (ook smoke);
Makkelijk te monteren met instructievideo;
Hecht uitstekend aan het windscherm!;
Niet tevreden? Geld terug!

 Het verbeteren van de verkeersveiligheid is essentieel voor Drive Hydro. Jaarlijks vinden er in Nederland ongeveer 430.000 verkeersongevallen plaats (Slachtofferhulp, 2020). Hier moet verandering in komen vind Drive Hydro. 
Meer informatie over het product? Dit kunt u vinden op de site van Drive Hydro !
 Inhoud Drive Hydro waterafstotende folie: 

1x Drie-laags Drive Hydro shield van 34 cm x 21 cm;
1x Anti-dust doek;
1x Alcoholdoek;
1x Guide stickers;
1x Rakel (voor het verwijderen van eventuele luchtbellen);
1x Instructieblad met QR code voor instructievideo.

 Geadviseerd wordt voor scooters tot de 42 km/u.
